package algorithmicTextbookTrack;

public class SharedKMer {
	
	public static String ReverseComplement(String dna){
		
		String complement = "";
		String reverseComplement = "";
		//finding complement of the sequence
		for(int i=0;i<dna.length();i++){
			if(dna.charAt(i) == 'A'){
				complement = complement + "T";
			}
			if(dna.charAt(i) == 'T'){
				complement = complement + "A";
			}
			if(dna.charAt(i) == 'C'){
				complement = complement + "G";
			}
			if(dna.charAt(i) == 'G'){
				complement = complement + "C";
			}
		}

		for(int x=(dna.length()-1);x>=0;x--){
			reverseComplement = reverseComplement + complement.charAt(x);
		}
		
		return reverseComplement;
	}
	
	public static void main(String[]args){
		String dna = "";
		String dna2 = "";
		int k = 13;
		
		for(int i=0;i<dna.length()-k+1;i=i+2){
			String temp = dna.substring(i,i+k);
			String tempA = dna.substring((i+1),i+k+1);
			for(int j=0;j<dna2.length()-k+1;j=j+2){
				String temp2 = dna2.substring(j,j+k);
				String tempA2 = dna2.substring(j+1,j+k+1);
				if(temp.equals(temp2)){
					System.out.println("(" + i + ", " + j + ")");
				}
				String revCom = ReverseComplement(temp2);
				if(temp.equals(revCom)){
					System.out.println("(" + i + ", " + j + ")");
				}
				
				if(tempA.equals(tempA2)){
					System.out.println("(" + (i+1) + ", " + (j+1) + ")");
				}
				String revCom2 = ReverseComplement(tempA2);
				if(tempA.equals(revCom2)){
					System.out.println("(" + (i+1) + ", " + (j+1) + ")");
				}
				
			}
		}
		
	}
}
